import React, {Component} from 'react';  
import {StyleSheet, Text, View,StatusBar} from 'react-native';  
import {createAppContainer} from 'react-navigation';   
import Icon from 'react-native-vector-icons/Ionicons';  
import {createMaterialTopTabNavigator} from'@react-navigation/material-top-tabs';;  

import MyTabs from './lib/router';  
const AppIndex = createAppContainer(MyTabs)  
// const Tab = createMaterialTopTabNavigator();

export default class App extends Component{  
    render(){  
        return(  
          <View style={{flex:1,backgroundColor:'#40B0DD'}} >  
          <StatusBar  
              backgroundColor='#3F51B5'  
              barStyle='light-content'  
          />  
          <View style={styles.header}>  
              <Icon style={{color:'black'}} name='ios-menu' size={28} color='white'/>  
              <Text style={{color:'black',fontSize:'2vw'}} >Perfect Weather</Text> 
              <Icon style={{color:'black'}} name='ios-search' size={28} color='white'/>  
          </View>  
          <AppIndex/>  
      </View>   
        )  
    }  
}  
const styles = StyleSheet.create({  
    wrapper: {  
        flex: 1,  
    },  
    header:{  
        flexDirection: 'row',  
        alignItems: 'center',  
        justifyContent: 'space-between',  
        backgroundColor: '#fff',  
        paddingHorizontal: 18,  
        paddingTop: 5,  
        // padding:'1vw',
        marginLeft:'1vw',
        marginRightt:'1vw',
        marginLeft:'1vw',
        marginLeft:'1vw',
        borderRadius:'10px'
    }  
});
